class Solution:
    def maximumMinimumPath(self, A: List[List[int]]) -> int:
        if not A or A[0][0] == 0:
            return 0
        
        N, M = len(A), len(A[0])
        vals = set()
        for row in A:
            vals |= set(row)
        
        def neighbors(r, c):
            return [(nr, nc) for nr, nc in [(r+1, c), (r-1, c), (r, c+1), (r, c-1)] if 0 <= nr < N and 0 <= nc < M]
        
        def check(val):
            if A[0][0] < val or A[N-1][M-1] < val:
                return False
            visa, visb = {(0, 0)}, {(N-1, M-1)}
            qa, qb = [(0, 0)], [(N-1, M-1)]
            while qa and qb:
                ra, ca = qa.pop()
                rb, cb = qb.pop()
                if (ra, ca) in visb or (rb, cb) in visa:
                    return True
                
                for nr, nc in neighbors(ra, ca):
                    k = (nr, nc)
                    if A[nr][nc] >= val and k not in visa:
                        visa.add(k)
                        qa.append(k)
                
                for nr, nc in neighbors(rb, cb):
                    k = (nr, nc)
                    if A[nr][nc] >= val and k not in visb:
                        visb.add(k)
                        qb.append(k)
            
            return False
            
        vals = list(sorted(vals))
        lo, hi = 0, len(vals)-1
        while lo <= hi:
            m = (lo + hi) // 2
            if check(vals[m]):
                lo = m + 1
            else:
                hi = m - 1
                
        return vals[hi]
    
